import './App.css';
import {useState} from "react";
import Axios from 'axios';

function App() {

  const[name,setName] = useState("");
  const[dateofbirth,setDateOfBirth] = useState("");
  const[email,setEmail] = useState("");
  const[phone,setPhone] = useState("");
  const[password,setPassword] = useState("");

  const addUser  = ()=>{
   Axios.post("http://localhost:3001/create", {
    name: name,
    dateofbirth: dateofbirth,
    email: email,
    phone: phone,
    password: password,
  }).then(()=>{
    console.log("success");
    });
  };


  return (
    <div className="App">
     <div className="form">
        <h1>Sign Up</h1>
        <label>Name: </label><input type="text"  required 
        onChange={(event) => { setName(event.target.value);}}/><br/>
        <label> Date of Birth:</label> 
        <input type="date" id="dob" 
         required  
        onChange={(event) => { setDateOfBirth(event.target.value);}}/><br/>
        <label>Email: </label>
        <input type="email" id="email" name="email"
        pattern="[a-z0-9._%+-]+@[a-z0-9.-]+\.[a-z]{2,}$" 
        onChange={(event) => { setEmail(event.target.value);}}/><br/>
        <label>Phone No: </label>
        <input type="tel" id="phone" pattern="\d{10,10}" required  
        onChange={(event) => { setPhone(event.target.value);}}/><br/>
        <label>Password:</label>
        <input type="password" onChange={(event) => { setPassword(event.target.value);}}/><br/>
        <div>
        <button className="button" onClick={addUser}>Submit</button>
        <button className="button1" onClick={addUser}>Show Users</button>
        </div>
    </div>

    </div>
  );
}

export default App;
